import React from 'react';
import '../styles/Footer.css';
import { Link, Routes } from 'react-router-dom';
import logo from '../components/Assets/logo.png';



function Footer() {
  return (
    <div className='nav-logo'>
        <img src={logo} alt="Логотип" />
        <p>Наценочка</p>
      </div>
  );
}

export default Footer;
